import React from "react";

function Front() {
  return (
    <div className="MainPage  flex-1  bg-gray-950">
     
        <div className="relative isolate mx-auto max-w-9xl py-12 text-center md:pb-28 md:pt-32 lg:pb-28 lg:pt-40">
          <div className="absolute insert-x-0 top-1/2 -z-10 -translate-y-1/2 transform-gpu overflow-hidden opacity-30 blur-3xl dark:hidden ">
            <h6 className="mx-auto inline-block max-w-md bg-gradient-to-r from-codeOrange to-purple bg-clip-text text-lg font-bold text-transparent md:text-xl ">
                 Change World With Web3.0
            </h6>
             <h1 className="mx-auto mt-2  max-w-xl bg-gradient-to-r from-codeOrange to-purple bg-clip-text text-3xl font-normal sm:max-w-2xl sm:rext-5xl lg:max-w-3xl lg:text-7xl  ">
                 Become a Future Web3 developer
            </h1>

          

        </div>

      </div>
    
    </div>
  );
}

export default Front;
